import logo from './logo.svg';
import './App.css';
// import {BrowserRouter as Router, Link, Route, Routes} from "react-router-dom";
// import React from "@types/react";

function App() {
  return (
      <Router>
        <div className="Demo">
          <p>Hello</p>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/login">About</Link>
            </li>
            <li>
              <Link to="/dashboard">Dashboard</Link>
            </li>
          </ul>

          <Routes>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/about">
              <About />
            </Route>
            <Route path="/dashboard">
              <Dashboard />
            </Route>
          </Routes>
        </div>
      </Router>
    // <div className="App">
